Diagnosis
. Male palp (
Figs 16a–b
) with reduced TA. MA with elongate proximal projection curving prolaterally, expanding to paddle shaped tip and with rather short and broad prolateral projection. Embolus with blunt tip. Palpal patella with one or two dorsal spines, palpal tibia with single slender dorsal spine. Female epigynum (
Figs 16c–d
) with pronounced, hook-like lateral teeth. Tarsal organ capsulate (
Figs 8a,e
), situated distally to trichobothria.
